import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { environment } from 'src/environments/environment';
import { jsPDF } from "jspdf";
import * as moment from 'moment';


@Injectable({
  providedIn: 'root'
})
export class InvoiceService {

  verticalOffset: number;
  tempindex = 0;

  public code: any = {
    qrCode: '',
    barCode: ''
  };

  image: any = "data:image/png;base64,"

  constructor(private http: HttpClient) { }

  getOrderInvoice(id) {
    return this.http.get(environment.apiUrl + `invoice?id=${id}`)
  }

  printInvoice(data: any) {
    const doc = new jsPDF();
    const PS = {
      fontSize: 12,
      logoSize: 24,
      margin: 10
    };
    const base64Img = this.image;
    this.verticalOffset = 10;
    doc.setFontSize(PS.fontSize + 3);
    doc.addImage(base64Img, 'JPEG', 10, 10, PS.logoSize, PS.logoSize);

    doc.text('SELLER ADDRESS:', 100, this.verticalOffset);
    doc.text('BILLING ADDRESS:', 155, this.verticalOffset);
    doc.setFontSize(PS.fontSize - 2);
    // seller address
    const sellPhone = data.invoice.seller.phoneNo;
    const sell = data.invoice.seller.sellerInformation;
    const sellerAddress = `${sell.name}, ${sell.fullAddress}, Phone No:${sellPhone}`;
    const sellerLines = doc.splitTextToSize(sellerAddress.toUpperCase(), 50);
    this.increaseVertical(5, doc);
    doc.text(sellerLines, 100, this.verticalOffset,);

    // Billing Address
    const bill = data.invoice.orderAddress;
    const billingAddress = `${bill.name}, ${bill.line1}, ${bill.line2} , ${bill.fullAddress},\nphone no. ${bill.mobileNo}`;
    const billing = doc.splitTextToSize(billingAddress.toUpperCase(), 50);
    doc.text(billing, 155, this.verticalOffset);
    this.increaseVertical(30, doc);
    doc.line(80, this.verticalOffset, 205, this.verticalOffset);
    this.increaseVertical(2, doc);
    // QR code
    doc.addImage(this.code.qrCode, 'PNG', 87, this.verticalOffset, PS.logoSize, PS.logoSize);
    // Bar code
    doc.addImage(this.code.barCode, 'JPEG', 117, this.verticalOffset, PS.logoSize, PS.logoSize);
    doc.setFontSize(PS.fontSize + 10);
    doc.text('TAX INVOICE', 150, this.verticalOffset + 5,);
    doc.setFontSize(PS.fontSize - 2);
    let invoiceId = data.invoice.invoiceId ? data.invoice.invoiceId : ''
    const invoiceNumber = `Invoice Number: ` + invoiceId;
    doc.text(invoiceNumber, 150, this.verticalOffset + 10);
    const invoiceDate = `Invoice Date: ${moment(data.invoice.date).format('MMM DD, YYYY')}`;
    doc.text(invoiceDate, 150, this.verticalOffset + 15);
    const deliveryDate = `Delivery Date: ${moment(data.invoice.deliveryDate.date ? data.invoice.deliveryDate.date : data.invoice.deliveryDate).format('MMM DD, YYYY')}`;
    doc.text(deliveryDate, 150, this.verticalOffset + 20);
    const deliverySlot = `Delivery Slot: ${data.invoice.deliveryTime.slot}`;
    doc.text(deliverySlot, 150, this.verticalOffset + 25);
    this.increaseVertical(5, doc);
    const gstText = 'GSTIN : ' + data.invoice.seller.taxInformation.gst.toUpperCase();
    doc.text(gstText, PS.margin, this.verticalOffset);
    this.increaseVertical(5, doc);
    const panText = 'PAN NO : ' + data.invoice.seller.taxInformation.pan.toUpperCase();
    doc.text(panText, PS.margin, this.verticalOffset);
    this.increaseVertical(5, doc);

    const pointOfSaleText = 'POINT OF SALE : ' + '09 ' + sell.city.toUpperCase() + ' U.P.';
    doc.text(pointOfSaleText, PS.margin, this.verticalOffset);
    this.increaseVertical(5, doc);
    const pointOfSupplyText = 'POINT OF SUPPLY : ' + '09 ' + sell.city.toUpperCase() + ' U.P.';
    doc.text(pointOfSupplyText, PS.margin, this.verticalOffset);
    this.increaseVertical(6, doc);
    doc.line(PS.margin, this.verticalOffset, 200, this.verticalOffset);
    let width1Percentage = 1.5;

    const table = {
      snoSize: 10,
      hsnSize: 10,
      skuSize: 20,
      particularSize: 40,
      unitSize: 10,
      gstSize: 10,
      qtySize: 10,
      rateSize: 10,
      qunatitySize: 8,
    };

    const snoX = 10,
      hsnX = snoX + width1Percentage * table.snoSize,
      skuX = hsnX + width1Percentage * table.hsnSize,
      particularX = skuX + width1Percentage * table.skuSize,
      unitX = particularX + width1Percentage * table.particularSize,
      gstX = unitX + width1Percentage * table.unitSize,
      rateX = gstX + width1Percentage * table.gstSize,
      qtyX = rateX + width1Percentage * table.rateSize,
      totalX = qtyX + width1Percentage * table.qunatitySize;
    // Table header top line
    this.increaseVertical(5, doc);
    // Table header values
    doc.text('S.No', snoX, this.verticalOffset);
    doc.text('HSN', hsnX, this.verticalOffset);
    doc.text('SKU', skuX, this.verticalOffset);
    doc.text('Particulars', particularX, this.verticalOffset);
    doc.text('Unit', unitX, this.verticalOffset);
    doc.text('Gst', gstX, this.verticalOffset);
    doc.text('Rate', rateX, this.verticalOffset);
    doc.text('Qty', qtyX, this.verticalOffset);
    doc.text('Total', totalX, this.verticalOffset);
    this.increaseVertical(2, doc);
    doc.line(PS.margin, this.verticalOffset, 200, this.verticalOffset);
    let products = data.invoice.products;
    let Tqty = 0;
    let Tvalue = 0;
    this.increaseVertical(4, doc);
    this.tempindex = 0;
    this.increaseVertical(1, doc);
    for (let i = 0; i < products.length; i++) {
      // s.no
      this.tempindex++;
      doc.text(this.tempindex + '.', snoX, this.verticalOffset);
      // HSN
      doc.text(this.pemTest(products[i].hsnCode, 4), hsnX, this.verticalOffset);
      // SKU
      doc.text(products[i].sku.toString(), skuX, this.verticalOffset);
      // unit
      doc.text(products[i].recommendedAttribute.toString(), unitX, this.verticalOffset);
      // gst
      doc.text(Math.round(products[i].gst).toString() + '%', gstX, this.verticalOffset);
      // Rate
      doc.text(((products[i].sellPrice * (100 / (100 + products[i].gst)))).toFixed(2).toString(), rateX, this.verticalOffset);
      // Qty
      doc.text(products[i].quantity.toString(), qtyX, this.verticalOffset);
      // Value
      doc.text((products[i].sellPrice * products[i].quantity).toFixed(2).toString(), totalX, this.verticalOffset);
      // particular
      const lines = products[i].name.match(/.{1,20}/g);
      for (let j = 0; j < lines.length; j++) {
        doc.text(lines[j].toUpperCase(), particularX, this.verticalOffset);
        this.increaseVertical(5, doc);
      }
      Tqty += products[i].quantity;
      Tvalue += (products[i].sellPrice * products[i].quantity);
      //this.increaseVertical(10, doc);
    }

    doc.line(PS.margin, this.verticalOffset, 200, this.verticalOffset);
    const discount = data.invoice.discount;
    let discountValue = 0;
    if (discount) {
      this.increaseVertical(4, doc);
      doc.text('Sub Total : ', 168, this.verticalOffset);
      doc.text(Math.round(Tvalue).toString(), 190, this.verticalOffset);
      this.increaseVertical(5, doc);
      doc.text('Offer discount: ', 162, this.verticalOffset);
      doc.text('- ' + discount, 188 + 1, this.verticalOffset);
      discountValue = Tvalue - discount;
      this.increaseVertical(2, doc);
      doc.line(160, this.verticalOffset, 200, this.verticalOffset);
    } else {
      discountValue = Tvalue;
    }
    let discountRatio = discountValue / Tvalue;
    doc.setFontSize(PS.fontSize + 1);
    this.increaseVertical(5, doc);
    // doc.setFontType('bold');
    doc.text('Delivery Charge:', 145, this.verticalOffset);
    doc.text(Math.round(data.invoice.deliveryCharge).toString(), 188, this.verticalOffset);

    this.increaseVertical(2, doc);
    
    
    doc.setFontSize(PS.fontSize + 1);
    this.increaseVertical(5, doc);
    doc.setFont("helvetica", "bold");
    doc.text('Total:',145, this.verticalOffset);
    doc.text(Math.round(discountValue+data.invoice.deliveryCharge).toString(),188, this.verticalOffset);

    this.increaseVertical(2, doc);
    doc.setFontSize(PS.fontSize - 2);
    doc.line(PS.margin, this.verticalOffset, 200, this.verticalOffset);
    width1Percentage = 2;
    const taxTable = {
      gstNoSize: 15,
      taxableAmtSize: 20,
      tax: 12,
      cgstSize: 12,
      sgstSize: 12,
      cessSize: 12,
      totalAmtSize: 15,
    };
    const gstNoX = 10,
      taxableAmtX = gstNoX + width1Percentage * taxTable.gstNoSize,
      taxX = taxableAmtX + width1Percentage * taxTable.taxableAmtSize,
      cgstX = taxX + width1Percentage * taxTable.tax,
      sgstX = cgstX + width1Percentage * taxTable.cgstSize,
      cessX = sgstX + width1Percentage * taxTable.sgstSize,
      totalAmtX = cessX + width1Percentage * taxTable.cessSize;
      this.increaseVertical(5, doc);
    doc.text('GST No.',gstNoX, this.verticalOffset);
    doc.text('Taxable Amt.',taxableAmtX, this.verticalOffset);
    doc.text('GST %',taxX, this.verticalOffset);
    doc.text('CGST',cgstX, this.verticalOffset);
    doc.text('SGST',sgstX, this.verticalOffset);
    doc.text('CESS',cessX, this.verticalOffset);
    doc.text('Total Amt.',totalAmtX, this.verticalOffset);
    // Table header bottom line
    this.increaseVertical(3, doc);
    doc.line(PS.margin, this.verticalOffset, 200, this.verticalOffset);
    // gst breakup value calculation and print
    this.increaseVertical(5, doc);
    let totalMrpPrice = 0;
    let totalSellPrice = 0;
    let tCgst = 0;
    let tSgst = 0;
    const gstGroupProducts = this.groupBy(products, 'gst');
    Object.keys(gstGroupProducts).map(function (key: any, index) {
      products = gstGroupProducts[key];
      // gst breakup value calculation
      let taxableAmt = 0,
        tax = parseInt(key),
        cgst = 0,
        sgst = 0,
        cess = 0,
        totalAmt = 0;
      for (let i = 0; i < products.length; i++) {
        const tp = discountRatio * (products[i].sellPrice * products[i].quantity);
        totalAmt += tp;
        const productTax = tp / (100 + tax) * tax;
        cgst += productTax / 2;
        sgst += productTax / 2;
        taxableAmt += tp - (productTax);
        totalMrpPrice += products[i].price * products[i].quantity;
        totalSellPrice += products[i].sellPrice * products[i].quantity;
      }
      tCgst += cgst;
      tSgst += sgst;
      // gst breakup value print
      doc.text((index + 1) + '.',gstNoX, this.verticalOffset);
      doc.text(taxableAmt.toFixed(2).toString(),taxableAmtX, this.verticalOffset);
      doc.text(tax + '%',taxX, this.verticalOffset);
      doc.text(cgst.toFixed(2).toString(),cgstX, this.verticalOffset, );
      doc.text(sgst.toFixed(2).toString(),sgstX, this.verticalOffset, );
      doc.text( '....',cessX, this.verticalOffset);
      doc.text(totalAmt.toFixed(2).toString(),totalAmtX, this.verticalOffset);
      this.increaseVertical(5, doc);
    }.bind(this));
    doc.line(PS.margin, this.verticalOffset, 200, this.verticalOffset);
    this.increaseVertical(4, doc);
    doc.setFont("helvetica", "bold");
    doc.text('Total',gstNoX, this.verticalOffset);
    doc.text(tCgst.toFixed(2).toString(),cgstX, this.verticalOffset);
    doc.text(tSgst.toFixed(2).toString(),sgstX, this.verticalOffset);
    doc.setFont("normal");
    this.increaseVertical(2, doc);
    doc.line(PS.margin, this.verticalOffset, 200, this.verticalOffset);
    doc.setFont("normal");
    doc.setFontSize(PS.fontSize);
    this.increaseVertical(8, doc);
    doc.text('Declaration:',PS.margin, this.verticalOffset);
    doc.text('Thank You For Your Business',PS.margin + 140,this.verticalOffset);
    this.increaseVertical(10, doc);
    doc.line(PS.margin + 140, this.verticalOffset, 195, this.verticalOffset);
    this.increaseVertical(5, doc);
    doc.text('Authorised Signatory',PS.margin + 145, this.verticalOffset);
    doc.setFontSize(PS.fontSize / 2);
    doc.text('Whether the tax is payable on RCM basis: No',PS.margin, this.verticalOffset);
    this.increaseVertical(4, doc);
    doc.text('We declare that this invoice shows the actual price of the goods described above all that all particulars are true and correct',PS.margin, this.verticalOffset);
    this.increaseVertical(4, doc);
    doc.text('* This is a computer generated invoice and does not require a physical signature',PS.margin, this.verticalOffset);
    doc.save(`${data.invoice.id}.pdf`);
  }

  increaseVertical(value, doc) {
    if (this.verticalOffset + 25 > doc.internal.pageSize.height) {
      doc.addPage();
      this.verticalOffset = 20;
    } else {
      this.verticalOffset += value;
    }
  }

  public groupBy = function (array, property) {
    const hash = {};
    for (let i = 0; i < array.length; i++) {
      if (!hash[array[i][property]]) { hash[array[i][property]] = []; }
      hash[array[i][property]].push(array[i]);
    }
    return hash;
  };
  
  public pemTest(num, size) {
    const ss = '000000' + num;
    return ss.substr(ss.length - size);
  }

}
